@testset "1.2.1.5 (a+b x+c x^2)^p (d+e x+f x^2)^q" begin
    (a, b, c, d, e, f, p, q, x, ) = @variables a b c d e f p q x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x+c*x^2)^p*(d+e*x+f*x^2)^q*with*c*e-b*f=0=#


    #= [(a + b*x + b*f/e*x^2)^3/sqrt(d + e*x + f*x^2), x, 0, (1/1024)*((1/(3*e^3*f^3))*(2*b*(e + 2*f*x)*sqrt(d + x*(e + f*x))*(1152*a^2*e^2*f^2 - 72*a*b*e*f*(3*e^2 - 8*e*f*x + 4*f*(3*d - 2*f*x^2)) + b^2*(15*e^4 - 40*e^3*f*x + 32*e*f^2*x*(-5*d + 8*f*x^2) + 8*e^2*f*(7*d + 11*f*x^2) + 16*f^2*(15*d^2 - 10*d*f*x^2 + 8*f^2*x^4)))) - ((-1024*a^3*e^3*f^3 + 384*a^2*b*e^2*f^2*(e^2 + 4*d*f) - 24*a*b^2*e*f*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2) + b^3*(5*e^6 + 12*d*e^4*f + 48*d^2*e^2*f^2 + 320*d^3*f^3))*log(e + 2*f*x + 2*sqrt(f)*sqrt(d + x*(e + f*x))))/(e^3*f^(7/2)))]
    @test_int [(a + b*x + b*f/e*x^2)^2/sqrt(d + e*x + f*x^2), x, 0, (1/(128*e^2*f^(5/2)))*(2*b*sqrt(f)*(e + 2*f*x)*sqrt(d + x*(e + f*x))*(32*a*e*f + b*(-3*e^2 + 8*e*f*x + 4*f*(-3*d + 2*f*x^2))) + (128*a^2*e^2*f^2 - 32*a*b*e*f*(e^2 + 4*d*f) + b^2*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2))*log(e + 2*f*x + 2*sqrt(f)*sqrt(d + x*(e + f*x))))] =#
    @test_int [(a + b*x + b*f/e*x^2)^1/sqrt(d + e*x + f*x^2), x, 4, (b*sqrt(d + e*x + f*x^2))/(4*f) + (b*x*sqrt(d + e*x + f*x^2))/(2*e) + ((8*a*f - b*(e + (4*d*f)/e))*atanh((e + 2*f*x)/(2*sqrt(f)*sqrt(d + e*x + f*x^2))))/(8*f^(3/2))]
    @test_int [1/((a + b*x + b*f/e*x^2)^1*sqrt(d + e*x + f*x^2)), x, 2, -((2*sqrt(e)*atanh((sqrt(b*d - a*e)*(e + 2*f*x))/(sqrt(e)*sqrt(b*e - 4*a*f)*sqrt(d + e*x + f*x^2))))/(sqrt(b*d - a*e)*sqrt(b*e - 4*a*f)))]
    #= [1/((a + b*x + b*f/e*x^2)^2*sqrt(d + e*x + f*x^2)), x, 0, (1/(2*((-b)*d + a*e)))*(sqrt(e)*((2*b*sqrt(e)*(e + 2*f*x)*sqrt(d + x*(e + f*x)))/((b*e - 4*a*f)*(a*e + b*x*(e + f*x))) + ((-8*a*e*f + b*(e^2 + 4*d*f))*log((-sqrt(b))*sqrt(e)*sqrt(b*e - 4*a*f) + b*(e + 2*f*x)))/(sqrt(b*d - a*e)*(b*e - 4*a*f)^(3/2)) + ((8*a*e*f - b*(e^2 + 4*d*f))*log(sqrt(b)*sqrt(e)*sqrt(b*e - 4*a*f) + b*(e + 2*f*x)))/(sqrt(b*d - a*e)*(b*e - 4*a*f)^(3/2)) + ((-8*a*e*f + b*(e^2 + 4*d*f))*log(sqrt(b)*(e^(3/2)*sqrt(b*e - 4*a*f) + sqrt(b)*(e^2 - 4*d*f) + 2*sqrt(e)*f*sqrt(b*e - 4*a*f)*x - 4*sqrt(b*d - a*e)*f*sqrt(d + x*(e + f*x)))))/(sqrt(b*d - a*e)*(b*e - 4*a*f)^(3/2)) + ((8*a*e*f - b*(e^2 + 4*d*f))*log(sqrt(b)*(e^(3/2)*sqrt(b*e - 4*a*f) - sqrt(b)*(e^2 - 4*d*f) + 2*sqrt(e)*f*sqrt(b*e - 4*a*f)*x + 4*sqrt(b*d - a*e)*f*sqrt(d + x*(e + f*x)))))/(sqrt(b*d - a*e)*(b*e - 4*a*f)^(3/2))))]
    @test_int [1/((a + b*x + b*f/e*x^2)^3*sqrt(d + e*x + f*x^2)), x, 0, (1/8)*sqrt(e)*((2*b*sqrt(e)*(e + 2*f*x)*sqrt(d + x*(e + f*x))*(-32*a^2*e^2*f + a*b*e*(5*e^2 - 24*e*f*x + 4*f*(5*d - 6*f*x^2)) + b^2*(3*e^2*x*(e + f*x) - 2*d*(e^2 - 6*e*f*x - 6*f^2*x^2))))/((b*d - a*e)^2*(b*e - 4*a*f)^2*(a*e + b*x*(e + f*x))^2) + ((128*a^2*e^2*f^2 - 32*a*b*e*f*(e^2 + 4*d*f) + b^2*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2))*log((-sqrt(b))*sqrt(e)*sqrt(b*e - 4*a*f) + b*(e + 2*f*x)))/((b*d - a*e)^(5/2)*(b*e - 4*a*f)^(5/2)) - ((128*a^2*e^2*f^2 - 32*a*b*e*f*(e^2 + 4*d*f) + b^2*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2))*log(sqrt(b)*sqrt(e)*sqrt(b*e - 4*a*f) + b*(e + 2*f*x)))/((b*d - a*e)^(5/2)*(b*e - 4*a*f)^(5/2)) + ((128*a^2*e^2*f^2 - 32*a*b*e*f*(e^2 + 4*d*f) + b^2*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2))*log(sqrt(b)*(e^(3/2)*sqrt(b*e - 4*a*f) + sqrt(b)*(e^2 - 4*d*f) + 2*sqrt(e)*f*sqrt(b*e - 4*a*f)*x - 4*sqrt(b*d - a*e)*f*sqrt(d + x*(e + f*x)))))/((b*d - a*e)^(5/2)*(b*e - 4*a*f)^(5/2)) - ((128*a^2*e^2*f^2 - 32*a*b*e*f*(e^2 + 4*d*f) + b^2*(3*e^4 + 8*d*e^2*f + 48*d^2*f^2))*log(sqrt(b)*(e^(3/2)*sqrt(b*e - 4*a*f) - sqrt(b)*(e^2 - 4*d*f) + 2*sqrt(e)*f*sqrt(b*e - 4*a*f)*x + 4*sqrt(b*d - a*e)*f*sqrt(d + x*(e + f*x)))))/((b*d - a*e)^(5/2)*(b*e - 4*a*f)^(5/2)))] =#


    @test_int [1/(sqrt(a + b*x + c*x^2)*(d + b*x + c*x^2)^1), x, 2, -((2*atanh((sqrt(a - d)*(b + 2*c*x))/(sqrt(b^2 - 4*c*d)*sqrt(a + b*x + c*x^2))))/(sqrt(a - d)*sqrt(b^2 - 4*c*d)))]
    @test_int [1/(sqrt(a + b*x + c*x^2)*(d + b*x + c*x^2)^2), x, 4, -(((b + 2*c*x)*sqrt(a + b*x + c*x^2))/((a - d)*(b^2 - 4*c*d)*(d + b*x + c*x^2))) + ((b^2 + 4*c*(a - 2*d))*atanh((sqrt(a - d)*(b + 2*c*x))/(sqrt(b^2 - 4*c*d)*sqrt(a + b*x + c*x^2))))/((a - d)^(3/2)*(b^2 - 4*c*d)^(3/2))]
    @test_int [1/(sqrt(a + b*x + c*x^2)*(d + b*x + c*x^2)^3), x, 5, -(((b + 2*c*x)*sqrt(a + b*x + c*x^2))/(2*(a - d)*(b^2 - 4*c*d)*(d + b*x + c*x^2)^2)) + (3*(b^2 + 4*c*(a - 2*d))*(b + 2*c*x)*sqrt(a + b*x + c*x^2))/(4*(a - d)^2*(b^2 - 4*c*d)^2*(d + b*x + c*x^2)) - ((3*b^4 + 8*b^2*c*(a - 4*d) + 16*c^2*(3*a^2 - 8*a*d + 8*d^2))*atanh((sqrt(a - d)*(b + 2*c*x))/(sqrt(b^2 - 4*c*d)*sqrt(a + b*x + c*x^2))))/(4*(a - d)^(5/2)*(b^2 - 4*c*d)^(5/2))]
    @test_int [1/(sqrt(a + b*x + c*x^2)*(d + b*x + c*x^2)^4), x, 6, -(((b + 2*c*x)*sqrt(a + b*x + c*x^2))/(3*(a - d)*(b^2 - 4*c*d)*(d + b*x + c*x^2)^3)) + (5*(b^2 + 4*c*(a - 2*d))*(b + 2*c*x)*sqrt(a + b*x + c*x^2))/(12*(a - d)^2*(b^2 - 4*c*d)^2*(d + b*x + c*x^2)^2) - ((15*b^4 + 8*b^2*c*(7*a - 22*d) + 16*c^2*(15*a^2 - 44*a*d + 44*d^2))*(b + 2*c*x)*sqrt(a + b*x + c*x^2))/(24*(a - d)^3*(b^2 - 4*c*d)^3*(d + b*x + c*x^2)) + ((b^2 + 4*c*(a - 2*d))*(5*b^4 - 8*b^2*c*(a + 4*d) + 16*c^2*(5*a^2 - 8*a*d + 8*d^2))*atanh((sqrt(a - d)*(b + 2*c*x))/(sqrt(b^2 - 4*c*d)*sqrt(a + b*x + c*x^2))))/(8*(a - d)^(7/2)*(b^2 - 4*c*d)^(7/2))]


    @test_int [1/((a*e + b*e*x + b*f*x^2)^2*sqrt(d + e*x + f*x^2)), x, 4, -((b*(e + 2*f*x)*sqrt(d + e*x + f*x^2))/(e*(b*d - a*e)*(b*e - 4*a*f)*(a*e + b*e*x + b*f*x^2))) - ((8*a*e*f - b*(e^2 + 4*d*f))*atanh((sqrt(b*d - a*e)*(e + 2*f*x))/(sqrt(e)*sqrt(b*e - 4*a*f)*sqrt(d + e*x + f*x^2))))/(e^(3/2)*(b*d - a*e)^(3/2)*(b*e - 4*a*f)^(3/2))]


    @test_int [1/((4 + 2*x + x^2)*sqrt(5 + 2*x + x^2)), x, 2, atan((1 + x)/(sqrt(3)*sqrt(5 + 2*x + x^2)))/sqrt(3)]


    @test_int [(a + e*x/2 + c*x^2)^p*(2*a + e*x + 2*c*x^2)^q, x, 2, -((2^(1 + q)*(-((e - sqrt(-16*a*c + e^2) + 4*c*x)/sqrt(-16*a*c + e^2)))^(-1 - p - q)*(2*a + e*x + 2*c*x^2)^(1 + p + q)*HypergeometricFunctions._₂F₁(-p - q, 1 + p + q, 2 + p + q, (e + sqrt(-16*a*c + e^2) + 4*c*x)/(2*sqrt(-16*a*c + e^2))))/(sqrt(-16*a*c + e^2)*(1 + p + q)))]
    @test_int [(a + c*e*x/f + c*x^2)^p*(a*f/c + e*x + f*x^2)^q, x, 2, -((2^(1 + p + q)*sqrt(c)*(-((sqrt(c)*(e - sqrt(c*e^2 - 4*a*f^2)/sqrt(c) + 2*f*x))/sqrt(c*e^2 - 4*a*f^2)))^(-1 - p - q)*(a + (c*e*x)/f + c*x^2)^p*((a*f)/c + e*x + f*x^2)^(1 + q)*HypergeometricFunctions._₂F₁(-p - q, 1 + p + q, 2 + p + q, (sqrt(c)*(e + sqrt(c*e^2 - 4*a*f^2)/sqrt(c) + 2*f*x))/(2*sqrt(c*e^2 - 4*a*f^2))))/(sqrt(c*e^2 - 4*a*f^2)*(1 + p + q)))]


