    @test_int [1/(sqrt(a + b*x + c*x^2)*sqrt(d + f*x^2)), x, 3, -(((b^2*d + b*sqrt(b^2 - 4*a*c)*d - 2*a*(c*d - a*f))^(1/4)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)^(3/2)*sqrt(2*a + (b + sqrt(b^2 - 4*a*c))*x)*sqrt(((4*a*c - (b + sqrt(b^2 - 4*a*c))^2)^2*(d + f*x^2))/(((b + sqrt(b^2 - 4*a*c))^2*d + 4*a^2*f)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)^2))*(1 + (sqrt(2*c^2*d - 2*a*c*f + b*(b + sqrt(b^2 - 4*a*c))*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x))/(sqrt(b^2*d + b*sqrt(b^2 - 4*a*c)*d - 2*a*(c*d - a*f))*(b + sqrt(b^2 - 4*a*c) + 2*c*x)))*sqrt((1 - (4*(b + sqrt(b^2 - 4*a*c))*(c*d + a*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x))/(((b + sqrt(b^2 - 4*a*c))^2*d + 4*a^2*f)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)) + ((4*c^2*d + (b + sqrt(b^2 - 4*a*c))^2*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x)^2)/(((b + sqrt(b^2 - 4*a*c))^2*d + 4*a^2*f)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)^2))/(1 + (sqrt(2*c^2*d - 2*a*c*f + b*(b + sqrt(b^2 - 4*a*c))*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x))/(sqrt(b^2*d + b*sqrt(b^2 - 4*a*c)*d - 2*a*(c*d - a*f))*(b + sqrt(b^2 - 4*a*c) + 2*c*x)))^2)*Elliptic.F(2*atan(((2*c^2*d - 2*a*c*f + b*(b + sqrt(b^2 - 4*a*c))*f)^(1/4)*sqrt(2*a + (b + sqrt(b^2 - 4*a*c))*x))/((b^2*d + b*sqrt(b^2 - 4*a*c)*d - 2*a*(c*d - a*f))^(1/4)*sqrt(b + sqrt(b^2 - 4*a*c) + 2*c*x))), (1/2)*(1 + ((b + sqrt(b^2 - 4*a*c))*(c*d + a*f))/(sqrt(2*c^2*d - 2*a*c*f + b*(b + sqrt(b^2 - 4*a*c))*f)*sqrt(b^2*d + b*sqrt(b^2 - 4*a*c)*d - 2*a*(c*d - a*f))))))/((4*a*c - (b + sqrt(b^2 - 4*a*c))^2)*(2*c^2*d - 2*a*c*f + b*(b + sqrt(b^2 - 4*a*c))*f)^(1/4)*sqrt(a + b*x + c*x^2)*sqrt(d + f*x^2)*sqrt(1 - (4*(b + sqrt(b^2 - 4*a*c))*(c*d + a*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x))/(((b + sqrt(b^2 - 4*a*c))^2*d + 4*a^2*f)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)) + ((4*c^2*d + (b + sqrt(b^2 - 4*a*c))^2*f)*(2*a + (b + sqrt(b^2 - 4*a*c))*x)^2)/(((b + sqrt(b^2 - 4*a*c))^2*d + 4*a^2*f)*(b + sqrt(b^2 - 4*a*c) + 2*c*x)^2))))]


